import Repository from '@/components/Repository'
import GitlabService from '@/services/GitlabService'

export default {
    name: 'RepositoryList',
    data() {
        return {
            members: []
        }
    },
    components: {
        Repository,
    },
    mounted() {
        this.getMembers()
    },
    methods: {
        async getMembers() {
            const response = await GitlabService.getRepomemebers()
            if (response.status !== 200) {
                return
            }
            this.members = response.data
        },
    }
}
